import axios from "axios";

export class CarService{

    baseUrl = "http://localhost:8080/api/v1/cars?start=2022-02-01&end=2022-02-01"

    getAvailable(start, end){
        console.log(start)
        console.log(end)
        return axios.get(this.baseUrl).then( res => res.data)
    }
}
